import React from 'react';

function Cars() {
    return (
        <>
        <div>Codel</div>
        <table className="table">
        <thead>
            <tr>
            <th scope="col">Id</th>
            <th scope="col">Model</th>
            <th scope="col">Type</th>
            </tr>
        </thead>
        </table>
        </>
    );
}

export default Cars;
